import styled from "styled-components";
import logo from "../../img/logo.png";

const HeaderContainer = styled.div`
    height: 70px;
    widht: 100%;
`;


class Header extends React.Component {



    render(){
        return (
            <HeaderContainer>
                <img src={logo}/>
                <h1>HEADER</h1>

            </HeaderContainer>
        );
    };
}



export default Header
